import { connect } from 'dva';
import { Button } from 'antd-mobile';

console.log("COMPONENT COUNT ")

function Count({ dispatch, count }) {
  console.log('lalalaFF', count);
  return (
    <div>
      <div>Count: {count.number}</div>
      <br />
      <div>
        <Button
          type="primary"
          onClick={() => {
            dispatch({ type: 'countModel/increase' });
          }}
        >
          Increase
        </Button>
        <Button
          type="ghost"
          onClick={() => {
            dispatch({ type: 'countModel/decrease' });
          }}
        >
          Decrease
        </Button>
      </div>
    </div>
  );
}

function mapStateToProps(state, props, m) {
  return {
    count: state.countModel,
  };
}

export default connect(mapStateToProps)(Count);
